import {makePostHelper} from "../javascript/Server"
import {expect} from "@jest/globals"
// const Expect = (func,...args) =>  {
//     try {
//         func(...args)
//     } catch (exception) {
//         return exception
//     }
// }

const testMakeFalsyPost = () => {
    const flawPostObj = {
        author : "Wonjae Lee"
    }

    expect(() => {makePostHelper("testPosts", flawPostObj)}).toThrow(new Error)
}

export const runTests = () => {
    testMakeFalsyPost();
}
